import{_ as a}from"./chunks/26.DQUWFvr3.js";import{_ as t,c as o,a0 as i,o as r}from"./chunks/framework.p2VkXzrt.js";const q=JSON.parse('{"title":"Componente Trámites","description":"","frontmatter":{},"headers":[],"relativePath":"tramites.md","filePath":"tramites.md"}'),n={name:"tramites.md"};function s(l,e,c,d,m,p){return r(),o("div",null,e[0]||(e[0]=[i('<h1 id="componente-tramites" tabindex="-1">Componente Trámites <a class="header-anchor" href="#componente-tramites" aria-label="Permalink to &quot;Componente Trámites&quot;">​</a></h1><h3 id="descripcion" tabindex="-1">Descripción <a class="header-anchor" href="#descripcion" aria-label="Permalink to &quot;Descripción&quot;">​</a></h3><p>El componente de trámites es una sección diseñada para guiar a los usuarios en la gestión de procedimientos administrativos o solicitudes. Aquí podrán consultar los requisitos, procedimientos y costos asociados para realizar trámites.</p><h3 id="estructura-para-los-tramites" tabindex="-1">Estructura para los Trámites: <a class="header-anchor" href="#estructura-para-los-tramites" aria-label="Permalink to &quot;Estructura para los Trámites:&quot;">​</a></h3><h3 id="titulo-del-tramite" tabindex="-1">Título del Trámite <a class="header-anchor" href="#titulo-del-tramite" aria-label="Permalink to &quot;Título del Trámite&quot;">​</a></h3><p>Un nombre claro que identifique el trámite de manera específica.</p><p><strong>Ejemplo:</strong> &quot;Acta de Nacimiento&quot;</p><hr><h3 id="breve-introduccion" tabindex="-1">Breve Introducción <a class="header-anchor" href="#breve-introduccion" aria-label="Permalink to &quot;Breve Introducción&quot;">​</a></h3><p>Una descripción corta (2-3 líneas) que explique de forma general el trámite y su propósito.</p><p><strong>Ejemplo:</strong></p><blockquote><p>Solicita tu acta de nacimiento de manera sencilla para trámites personales o legales.</p></blockquote><hr><h3 id="documentos-anexos" tabindex="-1">Documentos Anexos <a class="header-anchor" href="#documentos-anexos" aria-label="Permalink to &quot;Documentos Anexos&quot;">​</a></h3><p>Lista de documentos requeridos para realizar el trámite.</p><p><strong>Ejemplo:</strong></p><ul><li>Identificación oficial (INE, pasaporte, etc.).</li><li>Comprobante de domicilio.</li></ul><hr><h3 id="fechas-importantes" tabindex="-1">Fechas Importantes <a class="header-anchor" href="#fechas-importantes" aria-label="Permalink to &quot;Fechas Importantes&quot;">​</a></h3><p>Información sobre plazos, fechas de inscripción o vigencia del trámite, si aplica.</p><p><strong>Ejemplo:</strong></p><ul><li>Disponible todo el año.</li><li>Horario de atención: Lunes a viernes, 9:00 AM - 3:00 PM.</li></ul><hr><h3 id="costos" tabindex="-1">Costos <a class="header-anchor" href="#costos" aria-label="Permalink to &quot;Costos&quot;">​</a></h3><p>Detalla el precio del trámite, si tiene costo, y las formas de pago aceptadas.</p><p><strong>Ejemplo:</strong></p><ul><li>Costo: $200 MXN.</li><li>Métodos de pago: Efectivo, tarjeta bancaria, transferencia.</li></ul><hr><h3 id="modalidad-presencial-o-en-linea" tabindex="-1">Modalidad (Presencial o En Línea) <a class="header-anchor" href="#modalidad-presencial-o-en-linea" aria-label="Permalink to &quot;Modalidad (Presencial o En Línea)&quot;">​</a></h3><p>Especifica si el trámite puede realizarse presencialmente, en línea, o ambas opciones. Incluye URL para trámites en línea, si aplica.</p><p><strong>Ejemplo:</strong></p><ul><li>Presencial: En las oficinas del Registro Civil.</li><li>En línea: <a href="#">Realiza tu trámite aquí</a>.</li></ul><hr><h3 id="imagen-relacionada-al-tramite" tabindex="-1">Imagen Relacionada al Trámite <a class="header-anchor" href="#imagen-relacionada-al-tramite" aria-label="Permalink to &quot;Imagen Relacionada al Trámite&quot;">​</a></h3><p>Una imagen representativa, como un documento, un ícono o una foto ilustrativa.</p><hr><h3 id="beneficio-del-tramite" tabindex="-1">Beneficio del Trámite <a class="header-anchor" href="#beneficio-del-tramite" aria-label="Permalink to &quot;Beneficio del Trámite&quot;">​</a></h3><p>Resalta el principal beneficio que ofrece el trámite al usuario.</p><p><strong>Ejemplo:</strong></p><blockquote><p>Asegura que tu acta de nacimiento esté actualizada para trámites legales.</p></blockquote><hr><p>Esta estructura permite mostrar los trámites de forma organizada y accesible, facilitando que el usuario encuentre toda la información que necesita para realizarlos.</p><ul><li><strong>Boton &quot;Ver Servicio&quot;</strong> Este boton tiene como uso, redirijir a la pagina del Trámite.</li><li><strong>Boton &quot;Ver Más&quot;</strong> Este boton tiene como uso, redirijir a la pagina de los &quot;Trámites&quot;.</li></ul><h3 id="vista-del-componente" tabindex="-1">Vista del Componente <a class="header-anchor" href="#vista-del-componente" aria-label="Permalink to &quot;Vista del Componente&quot;">​</a></h3><p><img src="'+a+'" alt=""></p>',45)]))}const f=t(n,[["render",s]]);export{q as __pageData,f as default};
